import React from "react";
import styled from "styled-components";
const Box = styled.div`
  .box4-container {
    position: absolute;
    display: flex;
    flex-direction: column;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    height: 250px;
    width: 200px;
  }

  background: orange;
  height: 100px;
  width: 200px;
`;
const Box4 = () => {
  return <Box className="box4-container"></Box>;
};

export default Box4;
